import java.util.TreeSet;

/**
 * https://leetcode.com/tag/heap/
 *
 * @anchor https://leetcode.com/problems/find-k-th-smallest-pair-distance/description/
 * Find K-th Smallest Pair Distance
 */
class Solution {
    static class X_UNIT implements Comparable<X_UNIT> {
        static int count = 0;
        int value;
        int index = -1;

        public X_UNIT(int value) {
            this.value = value;
            this.index = count++;
        }


        @Override
        public int compareTo(X_UNIT o) {
            if (this.value != o.value) {
                return this.value - o.value;
            } else {
                return this.index - o.index;
            }
        }

        @Override
        public String toString() {
            return String.format("[%s:%s]", index, value);
        }
    }

    public int smallestDistancePair(int[] nums, int k) {
        TreeSet<X_UNIT> set = new TreeSet<>();
        for (int i = 0; i < nums.length; i++) {
            for (int j = i + 1; j < nums.length; j++) {
                set.add(new X_UNIT(
                        Math.abs(nums[i] - nums[j])
                ));
            }
        }
        try {
            assert (k <= set.size());
            X_UNIT x_unit;

            for (int i = 1; i <= k - 1; i++) {
                x_unit = set.first();
                set.remove(x_unit);
            }
            return set.first().value;
        } catch (Exception e) {


        }

        return -1;
    }
}

public class Main {
    public static void main(String[] args) {
        {
            int answer = new Solution().smallestDistancePair(new int[]{1, 3, 1, 9, 2}, 7);
            System.out.println(answer);
        }
        {
            int answer = new Solution().smallestDistancePair(new int[]{1, 6,1}, 3);
            System.out.println(answer);
        }

    }
}
